INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 1, 118501, 1, "2021/10/19 12:00:00", 2, 787, 0, 2.0, 0, 0, 0, 118501, 0, 450, 37, "カリン", 118501, "2030/12/31 15:00:00", 118501, "かりん", 37);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 1, 118601, 3, "2024/08/10 21:00:00", 2, 826, 0, 2.0, 0, 0, 0, 118601, 0, 450, 0, "ネビア", 118601, "2030/12/31 15:00:00", 118601, "ねびあ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (15, 0, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 119001, 3, "2021/11/03 19:00:00", 2, 714, 0, 2.27, 0, 0, 0, 119001, 0, 450, 7, "イオ（ノワール）", 119001, "2030/12/31 15:00:00", 119001, "いお", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (12, 0, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 119101, 3, "2021/11/16 12:00:00", 2, 143, 0, 2.545, 0, 0, 0, 119101, 0, 450, 7, "クウカ（ノワール）", 119101, "2030/12/31 15:00:00", 119101, "くうか", 26);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (5, 0, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 1, 119201, 1, "2023/09/19 15:00:00", 1, 397, 0, 2.19, 0, 0, 0, 119201, 0, 450, 6, "マヒル（クリスマス）", 119201, "2030/12/31 15:00:00", 119201, "まひる", 6);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 0, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 0, 119301, 3, "2021/12/22 12:00:00", 1, 762, 0, 1.97, 0, 0, 0, 119301, 0, 450, 8, "リノ（クリスマス）", 119301, "2030/12/31 15:00:00", 119301, "りの", 8);
