INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 1, 120701, 3, "2025/01/15 15:00:00", 1, 283, 0, 1.84, 0, 0, 0, 120701, 0, 450, 4, "シェフィ（ニューイヤー）", 120701, "2025/01/20 11:59:59", 120701, "しぇふぃ", 22);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (2, 0, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 1, 120801, 1, "2023/10/16 15:00:00", 1, 193, 0, 1.3, 0, 0, 0, 120801, 0, 450, 4, "ルカ（ニューイヤー）", 120801, "2030/12/31 15:00:00", 120801, "るか", 22);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (12, 0, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 1, 120901, 3, "2025/01/15 15:00:00", 2, 424, 0, 1.425, 0, 0, 0, 120901, 0, 450, 3, "イリヤ（ニューイヤー）", 120901, "2025/01/20 11:59:59", 120901, "いりや", 38);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 1, 121001, 3, "2025/02/20 12:00:00", 1, 164, 0, 2.25, 0, 0, 0, 121001, 0, 450, 5, "ペコリーヌ（オーバーロード）", 121001, "2025/02/24 11:59:59", 121001, "ぺこりーぬ", 41);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 1, 121101, 3, "2025/02/20 12:00:00", 2, 588, 0, 2.07, 0, 0, 0, 121101, 0, 450, 7, "キャル（オーバーロード）", 121101, "2025/02/24 11:59:59", 121101, "きゃる", 42);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 0, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 1, 121201, 1, "2023/11/16 15:00:00", 1, 260, 0, 1.55, 0, 0, 0, 121201, 0, 450, 4, "ラビリスタ（オーバーロード）", 121201, "2030/12/31 15:00:00", 121201, "らびりすた", 40);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (3, 0, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 121301, 3, "2022/03/03 19:00:00", 1, 731, 0, 1.9, 0, 0, 0, 121301, 0, 450, 3, "クルミ（ステージ）", 121301, "2030/12/31 15:00:00", 121301, "くるみ", 3);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (15, 0, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 121401, 3, "2022/03/15 15:00:00", 2, 742, 0, 2.27, 0, 0, 0, 121401, 0, 450, 7, "ミサキ（ステージ）", 121401, "2030/12/31 15:00:00", 121401, "みさき", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (12, 0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 1, 121501, 3, "2024/04/12 12:00:00", 1, 590, 0, 2.0, 0, 0, 0, 121501, 0, 450, 6, "アユミ（怪盗）", 121501, "2024/04/15 14:59:59", 121501, "あゆみ", 6);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (17, 0, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 121601, 3, "2022/04/15 15:00:00", 1, 292, 0, 1.425, 0, 0, 0, 121601, 0, 450, 3, "イノリ（怪盗）", 121601, "2030/12/31 15:00:00", 121601, "いのり", 3);
