INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (12, 0, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, 121901, 3, "2022/05/15 15:00:00", 2, 293, 0, 2.125, 0, 0, 0, 121901, 0, 450, 5, "アンナ（パイレーツ）", 121901, "2030/12/31 15:00:00", 121901, "あんな", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (14, 0, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, 122001, 3, "2022/05/03 19:00:00", 1, 380, 0, 1.425, 0, 0, 0, 122001, 0, 450, 3, "シノブ（パイレーツ）", 122001, "2030/12/31 15:00:00", 122001, "しのぶ", 3);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (9, 0, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 1, 122101, 1, "2024/04/18 15:00:00", 1, 731, 0, 1.97, 0, 0, 0, 122101, 0, 450, 35, "アオイ（キャンプ）", 122101, "2030/12/31 15:00:00", 122101, "あおい", 35);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, 0, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, 122201, 3, "2022/05/31 12:00:00", 1, 419, 0, 1.84, 0, 0, 0, 122201, 0, 450, 4, "ユカリ（キャンプ）", 122201, "2030/12/31 15:00:00", 122201, "ゆかり", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, 122301, 3, "2022/06/15 15:00:00", 2, 564, 0, 1.425, 0, 0, 0, 122301, 0, 450, 43, "ヴァンピィ", 122301, "2030/12/31 15:00:00", 122301, "うぁんぴぃ", 43);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (8, 0, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 122401, 1, "2024/06/17 15:00:00", 1, 264, 0, 2.42, 0, 0, 0, 122401, 0, 450, 1, "ヒヨリ（サマー）", 122401, "2030/12/31 15:00:00", 122401, "ひより", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 1, 122501, 3, "2024/08/26 19:00:00", 1, 250, 0, 1.965, 0, 0, 0, 122501, 0, 450, 4, "レイ（サマー）", 122501, "2024/08/31 11:59:59", 122501, "れい", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, 122601, 3, "2022/07/15 15:00:00", 2, 554, 0, 2.27, 0, 0, 0, 122601, 0, 450, 7, "ユイ（サマー）", 122601, "2030/12/31 15:00:00", 122601, "ゆい", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, 122701, 3, "2022/08/15 15:00:00", 2, 812, 0, 1.92, 0, 0, 0, 122701, 0, 450, 7, "キョウカ（サマー）", 122701, "2030/12/31 15:00:00", 122701, "きょうか", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 122801, 1, "2024/07/16 15:00:00", 1, 237, 0, 2.295, 0, 0, 0, 122801, 0, 450, 1, "ミソギ（サマー）", 122801, "2030/12/31 15:00:00", 122801, "みそぎ", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 1, 122901, 3, "2024/08/26 19:00:00", 1, 361, 0, 2.25, 0, 0, 0, 122901, 0, 450, 5, "ミミ（サマー）", 122901, "2024/08/31 11:59:59", 122901, "みみ", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 1, 123001, 3, "2025/02/28 12:00:00", 2, 746, 0, 2.27, 0, 0, 0, 123001, 0, 450, 44, "アメス", 123001, "2025/03/03 18:59:59", 123001, "あめす", 44);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, 123101, 3, "2022/09/03 19:00:00", 2, 793, 0, 1.795, 0, 0, 0, 123101, 0, 450, 7, "マホ（エクスプローラー）", 123101, "2030/12/31 15:00:00", 123101, "まほ", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, 123201, 3, "2022/09/15 15:00:00", 1, 256, 0, 1.425, 0, 0, 0, 123201, 0, 450, 3, "アヤネ（エクスプローラー）", 123201, "2030/12/31 15:00:00", 123201, "あやね", 3);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1, 123301, 3, "2024/09/25 12:00:00", 1, 350, 0, 1.62, 0, 0, 0, 123301, 0, 450, 1, "ネア", 123301, "2024/09/30 11:59:59", 123301, "ねあ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 0, 123401, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 123401, 0, 0, 5, "ジュン（キャンプ）", 0, "2030/12/31 15:00:00", 0, "じゅん", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 1, 123501, 1, "2024/09/17 15:00:00", 1, 583, 0, 2.34, 0, 0, 0, 123501, 0, 450, 6, "リン（ハロウィン）", 123501, "2030/12/31 15:00:00", 123501, "りん", 6);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 1, 123601, 3, "2024/10/24 12:00:00", 1, 262, 0, 1.965, 0, 0, 0, 123601, 0, 450, 4, "トモ（ハロウィン）", 123601, "2024/10/28 11:59:59", 123601, "とも", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, 123701, 3, "2022/10/15 15:00:00", 2, 741, 0, 2.07, 0, 0, 0, 123701, 0, 450, 7, "ナナカ（ハロウィン）", 123701, "2030/12/31 15:00:00", 123701, "ななか", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 123801, 3, "2024/11/26 12:00:00", 1, 238, 0, 2.295, 0, 0, 0, 123801, 0, 450, 1, "クリスティーナ（ワイルド）", 123801, "2024/11/30 11:59:59", 123801, "くりすてぃーな", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, 123901, 3, "2022/11/15 15:00:00", 1, 183, 0, 2.125, 0, 0, 0, 123901, 0, 450, 2, "マツリ（ワイルド）", 123901, "2030/12/31 15:00:00", 123901, "まつり", 2);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 1, 124001, 3, "2024/12/22 12:00:00", 2, 438, 0, 2.07, 0, 0, 0, 124001, 0, 450, 7, "アカリ（クリスマス）", 124001, "2024/12/31 11:59:59", 124001, "あかり", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 1, 124101, 1, "2024/11/16 15:00:00", 2, 433, 0, 1.965, 0, 0, 0, 124101, 0, 450, 6, "ヨリ（クリスマス）", 124101, "2030/12/31 15:00:00", 124101, "より", 6);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, 124201, 3, "2022/12/23 12:00:00", 1, 144, 0, 2.07, 0, 0, 0, 124201, 0, 450, 5, "ジュン（クリスマス）", 124201, "2030/12/31 15:00:00", 124201, "じゅん", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 124301, 3, "2015/04/01 15:00:00", 0, 577, 181001, 0.0, 1, 0, 0, 124301, 0, 0, 0, "アン（アン＆グレア）", 0, "2030/12/31 15:00:00", 0, "あん", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 124401, 3, "2015/04/01 15:00:00", 0, 577, 181001, 0.0, 1, 0, 0, 124401, 0, 0, 0, "グレア（アン＆グレア）", 0, "2030/12/31 15:00:00", 0, "ぐれあ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 1, 124501, 3, "2025/01/15 15:00:00", 2, 707, 0, 2.07, 0, 0, 0, 124501, 0, 450, 7, "ホマレ（ニューイヤー）", 124501, "2025/01/20 11:59:59", 124501, "ほまれ", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 1, 124601, 3, "2025/01/15 15:00:00", 2, 698, 0, 2.44, 0, 0, 0, 124601, 0, 450, 7, "ミサト（ニューイヤー）", 124601, "2025/01/20 11:59:59", 124601, "みさと", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 1, 124701, 1, "2024/12/16 15:00:00", 1, 590, 0, 2.24, 0, 0, 0, 124701, 0, 450, 7, "ミツキ（ニューイヤー）", 124701, "2030/12/31 15:00:00", 124701, "みつき", 46);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 1, 124801, 3, "2025/02/20 12:00:00", 1, 423, 0, 2.14, 0, 0, 0, 124801, 0, 450, 4, "ノゾミ（リベレイター）", 124801, "2025/02/24 11:59:59", 124801, "のぞみ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1, 124901, 1, "2025/01/16 15:00:00", 1, 170, 0, 1.965, 0, 0, 0, 124901, 0, 450, 1, "カヤ（リベレイター）", 124901, "2030/12/31 15:00:00", 124901, "かや", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 1, 125001, 3, "2025/02/20 12:00:00", 1, 221, 0, 1.965, 0, 0, 0, 125001, 0, 450, 5, "ムイミ（リベレイター）", 125001, "2025/02/24 11:59:59", 125001, "むいみ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, 125101, 3, "2023/03/03 19:00:00", 1, 825, 0, 2.24, 0, 0, 0, 125101, 0, 450, 8, "タマキ（カフェ）", 125101, "2030/12/31 15:00:00", 125101, "たまき", 47);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, 125201, 3, "2023/03/10 12:00:00", 1, 463, 0, 1.965, 0, 0, 0, 125201, 0, 450, 4, "モニカ（カフェ）", 125201, "2030/12/31 15:00:00", 125201, "もにか", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 1, 125301, 3, "2024/04/12 12:00:00", 1, 752, 0, 2.07, 0, 0, 0, 125301, 0, 450, 6, "コッコロ（レンジャー）", 125301, "2024/04/15 14:59:59", 125301, "こっころ", 6);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, 125401, 3, "2023/04/10 12:00:00", 1, 710, 0, 2.09, 0, 0, 0, 125401, 0, 450, 8, "シオリ（レンジャー）", 125401, "2030/12/31 15:00:00", 125401, "しおり", 8);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 1, 125501, 3, "2024/05/10 12:00:00", 2, 443, 0, 1.92, 0, 0, 0, 125501, 0, 450, 7, "ジータ（ウォーロック）", 125501, "2024/05/15 14:59:59", 125501, "じーた", 50);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 1, 125601, 3, "2024/05/10 12:00:00", 1, 267, 0, 2.09, 0, 0, 0, 125601, 0, 450, 51, "ビカラ", 125601, "2024/05/15 14:59:59", 125601, "びから", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 1, 125701, 1, "2023/04/30 12:00:00", 2, 579, 0, 2.24, 1, 0, 0, 125701, 0, 450, 7, "カリン（アルケミスト）", 125701, "2030/12/31 15:00:00", 125701, "かりん", 9);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 125801, 3, "2023/04/17 12:00:00", 1, 464, 0, 2.09, 0, 0, 0, 125801, 0, 450, 3, "リリ（フォールン）", 125801, "2030/12/31 15:00:00", 125801, "りり", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 125901, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 125901, 0, 0, 1, "カヤ（リベレイター）", 0, "2030/12/31 15:00:00", 0, "かや", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 126001, 3, "2023/10/31 12:00:00", 1, 406, 0, 2.09, 0, 0, 0, 126001, 0, 450, 0, "クリア（フォールン）", 126001, "2030/12/31 15:00:00", 126001, "くりあ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, 126101, 3, "2023/11/15 15:00:00", 2, 480, 0, 2.09, 0, 0, 0, 126101, 0, 450, 44, "プレシア（フォールン）", 126101, "2030/12/31 15:00:00", 126101, "ぷれしあ", 53);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 1, 126201, 3, "2024/06/10 12:00:00", 2, 568, 0, 2.09, 0, 0, 0, 126201, 0, 450, 3, "イリヤ（儀装束）", 126201, "2024/06/15 14:59:59", 126201, "いりや", 3);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, 126301, 3, "2023/06/15 15:00:00", 2, 456, 0, 2.07, 0, 0, 0, 126301, 0, 450, 7, "ユキ（儀装束）", 126301, "2030/12/31 15:00:00", 126301, "ゆき", 9);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 126401, 3, "2025/02/28 12:00:00", 1, 373, 0, 2.09, 0, 0, 0, 126401, 0, 450, 1, "クローチェ", 126401, "2025/03/03 18:59:59", 126401, "くろーちぇ", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 1, 126501, 3, "2025/02/28 12:00:00", 2, 740, 0, 1.965, 0, 0, 0, 126501, 0, 450, 7, "ライラエル", 126501, "2025/03/03 18:59:59", 126501, "らいらえる", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 1, 126601, 3, "2024/07/11 12:00:00", 2, 650, 0, 2.04, 0, 0, 0, 126601, 0, 450, 7, "ネネカ（サマー）", 126601, "2024/07/15 14:59:59", 126601, "ねねか", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 1, 126701, 1, "2023/06/30 12:00:00", 1, 224, 0, 1.965, 1, 0, 0, 126701, 0, 450, 5, "アキノ（サマー）", 126701, "2030/12/31 15:00:00", 126701, "あきの", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, 126801, 3, "2023/07/15 15:00:00", 1, 159, 0, 1.97, 0, 0, 0, 126801, 0, 450, 5, "ユカリ（サマー）", 126801, "2030/12/31 15:00:00", 126801, "ゆかり", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 1, 126901, 3, "2024/08/09 12:00:00", 2, 682, 0, 1.965, 0, 0, 0, 126901, 0, 450, 7, "ランファ（サマー）", 126901, "2024/08/12 11:59:59", 126901, "らんふぁ", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 1, 127001, 1, "2023/07/31 12:00:00", 1, 133, 0, 1.97, 1, 0, 0, 127001, 0, 450, 2, "クウカ（サマー）", 127001, "2023/08/14 20:59:59", 127001, "くうか", 52);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 1, 127101, 3, "2024/08/09 12:00:00", 1, 255, 0, 2.09, 0, 0, 0, 127101, 0, 450, 5, "シノブ（サマー）", 127101, "2024/08/12 11:59:59", 127101, "しのぶ", 46);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 1, 127201, 3, "2024/10/10 12:00:00", 2, 804, 0, 2.09, 0, 0, 0, 127201, 0, 450, 7, "キャル（編入生）", 127201, "2024/10/13 11:59:59", 127201, "きゃる", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, 127301, 3, "2023/09/15 15:00:00", 1, 750, 0, 2.09, 0, 0, 0, 127301, 0, 450, 8, "スズナ（編入生）", 127301, "2030/12/31 15:00:00", 127301, "すずな", 8);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 127401, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 127401, 0, 0, 1, "ビカラ（コラボ）", 0, "2030/12/31 15:00:00", 0, "びから", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 1, 127501, 3, "2024/11/11 12:00:00", 1, 304, 0, 2.09, 0, 0, 0, 127501, 0, 450, 4, "サレン（サラサリア）", 127501, "2024/11/18 11:59:59", 127501, "されん", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, 127601, 3, "2023/10/15 15:00:00", 1, 157, 0, 1.965, 0, 0, 0, 127601, 0, 450, 4, "ルカ（サラサリア）", 127601, "2030/12/31 15:00:00", 127601, "るか", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 0, 127701, 3, "2024/10/10 12:00:00", 2, 693, 0, 1.965, 0, 0, 0, 127701, 0, 450, 6, "リンド", 127701, "2030/12/31 15:00:00", 127701, "りんど", 48);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 0, 127801, 3, "2024/10/18 12:00:00", 2, 706, 0, 1.965, 0, 0, 0, 127801, 0, 450, 7, "ヴルム", 127801, "2030/12/31 15:00:00", 127801, "うるむ", 47);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 1, 127901, 3, "2024/12/09 12:00:00", 2, 372, 0, 1.965, 0, 0, 0, 127901, 0, 450, 5, "ペコリーヌ（クリスマス）", 127901, "2024/12/15 14:59:59", 127901, "ぺこりーぬ", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, 128001, 3, "2023/12/15 15:00:00", 1, 723, 0, 2.09, 0, 0, 0, 128001, 0, 450, 35, "クレジッタ（クリスマス）", 128001, "2030/12/31 15:00:00", 128001, "くれじった", 35);
