INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 1, 128301, 1, "2023/12/31 12:00:00", 1, 191, 0, 2.09, 1, 0, 0, 128301, 0, 450, 3, "イノリ（ニューイヤー）", 128301, "2030/12/31 15:00:00", 128301, "いのり", 38);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 1, 128401, 3, "2025/01/09 12:00:00", 2, 801, 0, 2.09, 0, 0, 0, 128401, 0, 450, 7, "ハツネ（ニューイヤー）", 128401, "2025/01/15 14:59:59", 128401, "はつね", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 1, 128501, 3, "2025/01/09 12:00:00", 2, 739, 0, 2.09, 0, 0, 0, 128501, 0, 450, 7, "カスミ（ニューイヤー）", 128501, "2025/01/15 14:59:59", 128501, "かすみ", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 128601, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 128601, 0, 0, 1, "リリ（フォールン）", 0, "2030/12/31 15:00:00", 0, "りり", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, 128701, 3, "2025/02/10 12:00:00", 1, 226, 0, 2.09, 0, 0, 0, 128701, 0, 450, 1, "ヒヨリ（アストラル）", 128701, "2025/02/15 14:59:59", 128701, "ひより", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 1, 128801, 1, "2024/01/31 12:00:00", 1, 194, 0, 1.965, 1, 0, 0, 128801, 0, 450, 4, "レイ（アストラル）", 128801, "2030/12/31 15:00:00", 128801, "れい", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 1, 128901, 3, "2025/02/10 12:00:00", 2, 772, 0, 2.09, 0, 0, 0, 128901, 0, 450, 7, "ユイ（アストラル）", 128901, "2025/02/15 14:59:59", 128901, "ゆい", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 1, 129001, 3, "2025/02/28 12:00:00", 2, 800, 0, 2.09, 0, 0, 0, 129001, 0, 450, 7, "エリス", 129001, "2025/03/03 18:59:59", 129001, "えりす", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 1, 129301, 3, "2024/09/25 12:00:00", 1, 708, 0, 2.09, 0, 0, 0, 129301, 0, 450, 7, "ユニ（ウィンター）", 129301, "2024/09/30 11:59:59", 129301, "ゆに", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 129401, 3, "2024/03/18 12:00:00", 1, 188, 0, 2.09, 0, 0, 0, 129401, 0, 450, 2, "クロエ（ウィンター）", 129401, "2030/12/31 15:00:00", 129401, "くろえ", 2);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, 129501, 3, "2024/12/15 15:00:00", 1, 247, 0, 2.09, 0, 0, 0, 129501, 0, 450, 1, "チエル（ウィンター）", 129501, "2024/12/22 11:59:59", 129501, "ちえる", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 1, 129601, 3, "2025/02/28 12:00:00", 1, 550, 0, 2.09, 0, 0, 0, 129601, 0, 450, 0, "アネモネ", 129601, "2025/03/03 18:59:59", 129601, "あねもね", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 1, 129701, 3, "2025/02/28 12:00:00", 1, 540, 0, 2.09, 0, 0, 0, 129701, 0, 450, 0, "ネフィ＝ネラ", 129701, "2025/03/03 18:59:59", 129701, "ねふぃーねら", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 1, 129801, 3, "2024/10/13 12:00:00", 1, 269, 0, 2.09, 0, 0, 0, 129801, 0, 450, 5, "マコト（コマンダー）", 129801, "2024/10/18 11:59:59", 129801, "まこと", 5);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 129901, 3, "2024/04/15 15:00:00", 1, 294, 0, 1.84, 0, 0, 0, 129901, 0, 450, 6, "エリコ（コマンダー）", 129901, "2030/12/31 15:00:00", 129901, "えりこ", 48);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 1, 130001, 3, "2024/11/11 12:00:00", 1, 150, 0, 2.09, 0, 0, 0, 130001, 0, 450, 4, "ヤマト", 130001, "2024/11/18 11:59:59", 130001, "やまと", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 1, 130101, 3, "2024/11/18 12:00:00", 1, 535, 0, 2.09, 0, 0, 0, 130101, 0, 450, 7, "ワカナ", 130101, "2024/11/26 11:59:59", 130101, "わかな", 9);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 1, 130201, 3, "2024/10/31 12:00:00", 1, 371, 0, 1.84, 0, 0, 0, 130201, 0, 450, 5, "フブキ", 130201, "2024/11/11 11:59:59", 130201, "ふぶき", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 130601, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 130601, 0, 0, 4, "レイ（アストラル）", 0, "2030/12/31 15:00:00", 0, "れい", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 1, 130701, 3, "2024/11/11 12:00:00", 2, 563, 0, 1.92, 0, 0, 0, 130701, 0, 450, 7, "キョウカ（スプリング）", 130701, "2024/11/18 11:59:59", 130701, "きょうか", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, 130801, 3, "2024/05/15 15:00:00", 2, 558, 0, 1.84, 0, 0, 0, 130801, 0, 450, 7, "スズメ（スプリング）", 130801, "2030/12/31 15:00:00", 130801, "すずめ", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, 130901, 3, "2024/06/15 15:00:00", 2, 440, 0, 2.09, 0, 0, 0, 130901, 0, 450, 7, "クルル", 130901, "2030/12/31 15:00:00", 130901, "くるる", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 1, 131001, 3, "2024/12/09 12:00:00", 2, 702, 0, 1.84, 0, 0, 0, 131001, 0, 450, 7, "マホ（ドリームパーク）", 131001, "2024/12/15 14:59:59", 131001, "まほ", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 131101, 3, "2024/06/30 12:00:00", 1, 165, 0, 2.09, 0, 0, 0, 131101, 0, 450, 2, "ネア（サマー）", 131101, "2030/12/31 15:00:00", 131101, "ねあ", 52);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 1, 131201, 3, "2025/01/09 12:00:00", 2, 753, 0, 2.09, 0, 0, 0, 131201, 0, 450, 35, "ミソラ（サマー）", 131201, "2025/01/15 14:59:59", 131201, "みそら", 35);
