INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 1, 131601, 3, "2025/01/09 12:00:00", 1, 399, 0, 1.92, 0, 0, 0, 131601, 0, 450, 4, "リリ（サマー）", 131601, "2025/01/15 14:59:59", 131601, "りり", 4);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 1, 131701, 3, "2025/02/10 12:00:00", 2, 743, 0, 1.92, 0, 0, 0, 131701, 0, 450, 44, "アメス（サマー）", 131701, "2025/02/15 14:59:59", 131701, "あめす", 53);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, 131801, 3, "2024/08/15 15:00:00", 2, 709, 0, 2.09, 0, 0, 0, 131801, 0, 450, 7, "ホマレ（サマー）", 131801, "2030/12/31 15:00:00", 131801, "ほまれ", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 1, 131901, 1, "2024/08/31 12:00:00", 2, 725, 0, 2.09, 1, 0, 0, 131901, 0, 450, 7, "エミリア（サマー）", 131901, "2030/12/31 15:00:00", 131901, "えみりあ", 23);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 1, 132001, 3, "2024/09/13 12:00:00", 2, 775, 0, 2.09, 0, 0, 0, 132001, 0, 450, 7, "エキドナ（サマー）", 132001, "2024/09/25 11:59:59", 132001, "えきどな", 21);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 1, 132101, 3, "2024/08/31 12:00:00", 1, 146, 0, 2.09, 0, 0, 0, 132101, 0, 450, 13, "レム（サマー）", 132101, "2024/09/13 11:59:59", 132101, "れむ", 24);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 1, 132201, 3, "2024/09/30 12:00:00", 2, 721, 0, 1.84, 0, 0, 0, 132201, 0, 450, 7, "ノゾミ（アルケミスト）", 132201, "2024/10/10 11:59:59", 132201, "のぞみ", 7);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 1, 132801, 3, "2024/11/30 12:00:00", 2, 750, 0, 2.09, 0, 0, 0, 132801, 0, 450, 7, "ライラエル（クリスマス）", 132801, "2024/12/09 11:59:59", 132801, "らいらえる", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, 132901, 3, "2024/12/09 12:00:00", 2, 748, 0, 2.09, 0, 0, 0, 132901, 0, 450, 5, "イオ（クリスマス）", 132901, "2030/12/31 15:00:00", 132901, "いお", 46);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 1, 133001, 3, "2025/02/28 12:00:00", 1, 234, 0, 2.09, 0, 0, 0, 133001, 0, 450, 0, "グレイス", 133001, "2025/03/03 18:59:59", 133001, "ぐれいす", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 1, 133201, 1, "2024/12/31 12:00:00", 1, 296, 0, 2.09, 1, 0, 0, 133201, 0, 450, 4, "モニカ（ニューイヤー）", 133201, "2030/12/31 15:00:00", 133201, "もにか", 22);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 1, 133501, 3, "2025/01/03 19:00:00", 2, 718, 0, 2.09, 0, 0, 0, 133501, 0, 450, 4, "サレン（ニューイヤー）", 133501, "2025/01/15 14:59:59", 133501, "されん", 22);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 1, 133601, 3, "2025/01/20 12:00:00", 1, 445, 0, 2.09, 0, 0, 0, 133601, 0, 450, 0, "メドゥーサ", 133601, "2025/01/31 11:59:59", 133601, "めどぅーさ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 1, 133701, 3, "2025/01/31 12:00:00", 2, 717, 0, 2.09, 0, 0, 0, 133701, 0, 450, 8, "ラビリスタ（アルファ）", 133701, "2025/02/10 11:59:59", 133701, "らびりすた", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 1, 133801, 3, "2025/02/20 12:00:00", 2, 759, 0, 2.09, 0, 0, 0, 133801, 0, 450, 7, "ネネカ（アルファ）", 133801, "2025/02/28 11:59:59", 133801, "ねねか", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 1, 133901, 3, "2025/02/10 12:00:00", 1, 228, 0, 2.09, 0, 0, 0, 133901, 0, 450, 6, "クリスティーナ（アルファ）", 133901, "2025/02/20 11:59:59", 133901, "くりすてぃーな", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 1, 134001, 3, "2025/02/28 12:00:00", 2, 746, 0, 2.09, 0, 0, 0, 134001, 0, 450, 0, "フィオ", 134001, "2025/03/03 18:59:59", 134001, "ふぃお", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 134101, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 134101, 0, 0, 5, "フブキ", 0, "2030/12/31 15:00:00", 0, "ふぶき", 1);
