INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 1, 136801, 3, "2015/04/01 15:00:00", 0, 0, 0, 0.0, 0, 0, 0, 136801, 0, 0, 7, "ランファ（儀装束）", 0, "2030/12/31 15:00:00", 0, "らんふぁ", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (4, 0, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 0, 170101, 3, "2015/04/01 15:00:00", 1, 245, 0, 1.965, 0, 0, 0, 170101, 0, 450, 34, "ジータ", 170101, "2030/12/31 15:00:00", 105701, "じーた", 34);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 1, 180101, 3, "2025/02/28 12:00:00", 1, 199, 0, 1.62, 0, 0, 0, 180101, 0, 450, 0, "ヒヨリ（プリンセス）", 180101, "2025/03/03 18:59:59", 180101, "ひより", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 1, 180201, 3, "2025/02/28 12:00:00", 2, 767, 0, 1.92, 0, 0, 0, 180201, 0, 450, 0, "ユイ（プリンセス）", 180201, "2025/03/03 18:59:59", 180201, "ゆい", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (7, 0, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 1, 180301, 3, "2025/02/28 12:00:00", 1, 377, 0, 1.965, 0, 0, 0, 180301, 0, 450, 0, "レイ（プリンセス）", 180301, "2025/03/03 18:59:59", 180301, "れい", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 1, 180401, 3, "2025/02/28 12:00:00", 1, 155, 0, 1.965, 0, 0, 0, 180401, 0, 450, 0, "ペコリーヌ（プリンセス）", 180401, "2025/03/03 18:59:59", 180401, "ぺこりーぬ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 1, 180501, 3, "2025/02/28 12:00:00", 1, 555, 0, 2.14, 0, 0, 0, 180501, 0, 450, 0, "コッコロ（プリンセス）", 180501, "2025/03/03 18:59:59", 180501, "こっころ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 1, 180601, 3, "2025/02/28 12:00:00", 2, 747, 0, 1.92, 0, 0, 0, 180601, 0, 450, 0, "キャル（プリンセス）", 180601, "2025/03/03 18:59:59", 180601, "きゃる", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 1, 180701, 3, "2025/02/28 12:00:00", 1, 732, 0, 1.75, 0, 0, 0, 180701, 0, 450, 0, "ハツネ＆シオリ", 180701, "2025/03/03 18:59:59", 180701, "はつねしおり", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 1, 180801, 3, "2025/02/28 12:00:00", 1, 465, 0, 1.5, 0, 0, 0, 180801, 0, 450, 0, "ミソギ＆ミミ＆キョウカ", 180801, "2025/03/03 18:59:59", 180801, "みそぎみみきょうか", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 1, 180901, 3, "2025/02/28 12:00:00", 1, 421, 0, 2.09, 0, 0, 0, 180901, 0, 450, 0, "アキノ＆サレン", 180901, "2025/03/03 18:59:59", 180901, "あきのされん", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 1, 181001, 3, "2025/02/28 12:00:00", 2, 577, 0, 2.09, 0, 0, 0, 181001, 0, 450, 0, "アン＆グレア", 181001, "2025/03/03 18:59:59", 181001, "あんぐれあ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 1, 181101, 3, "2025/02/28 12:00:00", 1, 551, 0, 1.92, 0, 0, 0, 181101, 0, 450, 0, "シズル＆リノ", 181101, "2025/03/03 18:59:59", 181101, "しずるりの", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (1, 0, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", 1, 181201, 3, "2025/02/28 12:00:00", 1, 368, 0, 1.92, 0, 0, 0, 181201, 0, 450, 0, "シェフィ（プリンセス）", 181201, "2025/03/03 18:59:59", 181201, "しぇふぃ", 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 0, 190801, 1, "2015/04/01 15:00:00", 1, 0, 0, 0.0, 0, 0, 0, 190801, 0, 0, 1, "カリン", 0, "2030/12/31 15:00:00", 0, "かりん", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "", 0, 191201, 1, "2015/04/01 15:00:00", 1, 0, 0, 0.0, 0, 0, 0, 191201, 0, 0, 1, "ペテルギウス", 0, "2030/12/31 15:00:00", 0, "ぺてるぎうす", 1);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 1, 191301, 1, "2015/04/01 15:00:00", 1, 850, 0, 2.22, 0, 0, 0, 191301, 0, 450, 6, "カズマサ", 191301, "2030/12/31 15:00:00", 191301, "かずまさ", 6);
